styles:
:host {
  display: block;
  width: 100%;
}

:host table {
  border-collapse: collapse;
  width: 100%;
}

:host table th {
  font-family: "Blackbaud Sans", "Helvetica Neue", Arial, sans-serif;
  color: #686c73;
  font-weight: 400;
  font-size: 15px;
}

:host table th,
:host table td {
  padding: 10px 10px 10px 0;
  text-align: left;
}

:host table th.link-records-item-diff-update,
:host table td.link-records-item-diff-update {
  word-break: normal;
  text-align: center;
  width: 50px;
}

:host table th.link-records-item-diff-value,
:host table td.link-records-item-diff-value {
  word-break: break-all;
  white-space: pre-line;
}

:host table th.item-deemphasized,
:host table td.item-deemphasized {
  font-family: "Blackbaud Sans", "Helvetica Neue", Arial, sans-serif;
  color: #686c73;
  font-weight: 400;
  font-size: 15px;
  font-style: italic;
}

:host table th.item-highlighted,
:host table td.item-highlighted {
  font-weight: 600;
}

:host table tbody tr {
  border-bottom: 1px dotted #cdcfd2;
}

:host table tbody tr:first-child {
  border-top: 1px dotted #cdcfd2;
}

:host /deep/ sky-checkbox .sky-checkbox {
  display: flex;
  align-items: center;
  justify-content: center;
  margin: auto;
